import React from 'react';
import { Line } from "react-chartjs-2";
import "./DefectChart.css"
import * as FaIcons from 'react-icons/fa'


import {
  LineChart_Defect, 
} from "./LineChart";

import {
  ProductionLineAll,
  ProductionLine1,
  ProductionLine2,
  ProductionLine1Chart
} from "./MockChartData";

const DefectChart = ({ProductionLineState, DefectState, LineChart_Defect_Example1}) => {
if(ProductionLineState=="HourlyData"){
    var title = "Hourly";
}
if(ProductionLineState=="DailyData"){
    var title = "Daily";
}
if(ProductionLineState=="MonthlyData"){
    var title = "Monthly";
}

        return (
    <>

            <div className='Defect'>

                <div className='Defect-header'>
                  <FaIcons.FaChartArea className='Defect-icon' size={20} color={'white'}/>
                  <h3 className='Defect-title'>{title} Example Chart For Defect</h3>
                </div>

              <div className="Defect-body">
                  <div className="Defect-chart">
                    <Line
                      data={LineChart_Defect[LineChart_Defect_Example1, ProductionLineState, DefectState]}
                      options={LineChart_Defect.options}
                    />
                  </div>

              </div>
            </div>

     </>
        )

};

export default DefectChart;
